import React from "react";
import Header from "./Header";
import SearchBar from "./SearchBar";

class App extends React.Component {
  onSearchSubmit(searchInput) {
    console.log(searchInput);
  }
  render() {
    return (
      <div>
        <Header>
          <SearchBar onsubmit={this.onSearchSubmit} />
        </Header>
      </div>
    );
  }
}

export default App;
